response.interests:
Обязанности водителя: 
Техническая грамотность и знание устройства современного автомобиля; 
Подача автомобиля строго в назначенное время; 
Содержание автомобиля в чистоте и исправном состоянии (мойка, ТО); 
Выполнение поручений работодателя, связанных с другими членами семьи или профессионального и личного характера; 
Предоставление отчетности по полученным денежным средствам в форме и в срок, требуемых работодателем; 
Хранение автомобиля в ночное время только в согласованных с работодателем местах; 
Своевременная заправка бензином.
